import Committee from '../views/Committee';
import Home from '../views/Home';
import Sumary from '../views/Sumary';

const pages = [
  {
    path: '/',
    sidebarName: 'INICIO',
    component: Home,
  },
  {
    path: '/committee',
    sidebarName: 'COMITÉ',
    component: Committee,
  },
  {
    path: '/',
    sidebarName: 'PROGRAMA',
    component: Home,
  },
  {
    path: '/committee',
    sidebarName: 'CONFERENCISTAS',
    component: Committee,
  },
  {
    path: '/summary',
    sidebarName: 'RESUMENES',
    component: Sumary,
  },
  {
    path: '/committee',
    sidebarName: 'ENLACES',
    component: Committee,
  },
  {
    path: '/committee',
    sidebarName: 'INSCRIPCIONES',
    component: Committee,
  },

];

export default pages;
